        "    *   **Inference:** Repeat buying is limited to a small segment.\n",
        "    *   **Business Action:** Encourage repeat purchases through loyalty programs or bundled offers.\n",
        "\n",
        "3.  **Monetary Distribution**\n",
        "    *   **Observation:** A few customers contribute the majority of revenue.\n",
        "    *   **Inference:** High-value customers are critical for overall business.\n",
