        "    *   **Observation:** Clear segmentation into High-Value, Regular, Occasional, and At-Risk customers.\n",
        "    *   **Inference:** Customers with similar purchase patterns group together.\n",
        "    *   **Business Action:** Tailor marketing, retention, and product recommendations per segment.\n",
        "\n",
        "5.  **Average Monetary Value by Customer Segment**\n",
        "    *   **Observation:** High-Value segment shows the highest average spending, At-Risk the lowest.\n",
        "    *   **Inference:** Revenue is concentrated among a small loyal segment.\n",
        "    *   **Business Action:** Prioritize High-Value customers for upselling; target At-Risk for reactivation.\n",
        "\n",
        "6.  **Recency vs Frequency Heatmap**\n",
