    {
      "cell_type": "markdown",
      "metadata": {
        "id": "38SU8ai_13bF"
      },
      "source": [
        "1 Clustering Evaluation Metrics (RFM Segmentation)\n",
        "\n",
        " What this does:\n",
        "\n",
        "Inertia tells how tight clusters are (lower is better).\n",
        "\n",
        "Silhouette score tells how well-separated clusters are (closer to 1 = better).\n",
        "\n",
        "Adds Cluster labels to your dataset for further analysis."
      ]
    },
    {
      "cell_type": "code",
      "execution_count": 27,
      "metadata": {
        "colab": {
          "base_uri": "https://localhost:8080/"
        },
        "id": "A0igMtHH1-nc",
        "outputId": "14ee1b0c-a948-42ca-aba5-db94f22d0e32"
      },
      "outputs": [
        {
          "output_type": "stream",
          "name": "stdout",
          "text": [
            "KMeans Inertia: 1427.8405773701295\n",
            "Silhouette Score: 0.5583508134888864\n"
          ]
        }
      ],
      "source": [
        "# Import required libraries\n",
        "from sklearn.cluster import KMeans\n",
        "from sklearn.preprocessing import StandardScaler\n",
        "from sklearn.metrics import silhouette_score\n",
        "\n",
        "# Assume rfm contains RFM values: 'Recency', 'Frequency', 'Monetary'\n",
        "rfm_features = rfm[['Recency','Frequency','Monetary']]\n",
        "\n",
        "# Standardize the features\n",
        "scaler = StandardScaler()\n",
        "rfm_scaled = scaler.fit_transform(rfm_features)\n",
        "\n",
        "# Fit KMeans\n",
        "kmeans = KMeans(n_clusters=4, random_state=42)\n",
        "kmeans.fit(rfm_scaled)\n",
        "\n",
        "# Add cluster labels to the original dataframe\n",
        "rfm['Cluster'] = kmeans.labels_\n",
        "\n",
        "# -------------------------------\n",
        "# Evaluation Metrics\n",
        "# -------------------------------\n",
        "\n",
        "# 1. Inertia (Sum of squared distances to nearest cluster center)\n",
        "print(\"KMeans Inertia:\", kmeans.inertia_)\n",
        "\n",
        "# 2. Silhouette Score (measure of how well clusters are separated)\n",
        "sil_score = silhouette_score(rfm_scaled, kmeans.labels_)\n",
        "print(\"Silhouette Score:\", sil_score)\n",
        "\n",
        "# Higher silhouette score (~1) means clusters are well-separated"
      ]
    },
    {
      "cell_type": "markdown",
      "metadata": {
        "id": "DBYYVW-b2I2s"
      },
      "source": [
        "2 Product Similarity Using Collaborative Filtering (Cosine Similarity)\n",
        "\n",
        " What this does:\n",
        "\n",
        "Calculates similarity between all products using Cosine Similarity.\n",
        "\n",
        "Returns top 5 similar products for a given input product.\n",
        "\n",
        "Ready to integrate into Streamlit Product Recommendation module."
      ]
    },
    {
      "cell_type": "code",
      "execution_count": 28,
      "metadata": {
        "id": "NwrWTys629K7"
      },
      "outputs": [],
      "source": [
        "#Create Product-User Matrix\n",
        "\n",
        "import pandas as pd\n",
        "\n",
        "# The dataframe 'df' is already loaded from 'online_retail.csv'\n",
        "# df should have columns: 'CustomerID', 'Description', 'Quantity'\n",
        "\n",
        "# Create product-user matrix\n",
        "# Rows = products (Description), Columns = CustomerID, Values = Quantity purchased (fill NaN with 0)\n",
        "product_user_matrix = pd.pivot_table(df,\n",
        "                                     index='Description',\n",
        "                                     columns='CustomerID',\n",
        "                                     values='Quantity',\n",
        "                                     fill_value=0)"
      ]
    },
    {
      "cell_type": "code",
      "execution_count": 29,
      "metadata": {
        "id": "BsRoCMcd3NJR"
      },
      "outputs": [],
      "source": [
        "#Compute Cosine Similarity\n",
        "\n",
        "from sklearn.metrics.pairwise import cosine_similarity\n",
        "\n",
        "# Compute similarity between products\n",
        "cos_sim = cosine_similarity(product_user_matrix)\n",
        "cos_sim_df = pd.DataFrame(cos_sim,\n",
        "                          index=product_user_matrix.index,\n",
        "                                                    columns=product_user_matrix.index)\n"
      ]
    },
    {
      "cell_type": "code",
      "execution_count": 30,
      "metadata": {
        "id": "goT3an6T3RRM"
      },
      "outputs": [],
      "source": [
        "#Recommendation Function\n",
        "\n",
        "def recommend_products(product_name, top_n=5):\n",
        "    if product_name not in cos_sim_df.columns:\n",
        "        return f\"Product '{product_name}' not found in dataset.\"\n",
        "\n",
        "    similar_scores = cos_sim_df[product_name].sort_values(ascending=False)\n",
        "    similar_products = similar_scores.iloc[1:top_n+1].index.tolist()  # skip itself\n",
        "    return similar_products\n",
        "\n",
        "# Example usage\n",
        "# recommend_products(\"Product_A\", top_n=5)"
      ]
    },
