        "\n",
        "def recommend_products(product_name, top_n=5):\n",
        "    # Normalize input\n",
        "    product_name = product_name.strip().lower()\n",
        "\n",
        "    # Normalize product names in dataset\n",
        "    products = [p.lower() for p in cos_sim_df.columns]\n",
        "\n",
        "    if product_name not in products:\n",
        "        # Suggest closest matches\n",
        "        matches = get_close_matches(product_name, products, n=3, cutoff=0.5)\n",
        "        if matches:\n",
        "            return f\"Product not found. Did you mean: {matches}?\"\n",
        "        else:\n",
        "            return f\"Product '{product_name}' not found in dataset.\"\n",
        "\n",
        "    # Find the actual column name matching input\n",
        "    actual_product = cos_sim_df.columns[products.index(product_name)]\n",
        "\n",
        "    # Get top N similar products\n",
        "    similar_scores = cos_sim_df[actual_product].sort_values(ascending=False)\n",
        "    similar_products = similar_scores.iloc[1:top_n+1].index.tolist()  # skip itself\n",
        "    return similar_products\n",
        "\n",
        "# Example usage\n",
        "# recommend_products(\"pencils small tube red retrospot\", top_n=5)"
